import { useState } from "react";

function App() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count + 1);
  }

  function Button(attr) {
    return(
      <button onClick={handleClick}>
        Clicked {attr.count} times
      </button>
    );
  }

  return (
    <div>
      <Button count = {count} />
      <Button count = {count} />
    </div>
  );
}
export default App;
